        ships = this.props.ships;
        return (
            this.props.ships.map((ship) => 
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{ship.name}</h5>

              </div>
            </div>
          )
        )

      }

    }
export default Suggestions
